    def gcd(a, b):
        while b:
            a, b = b, a % b
        return a

    def merge_lists(list1, list2):
        return list(set(list1) | set(list2))

    def is_permutation(list1, list2):
        return sorted(list1) == sorted(list2)

    def is_valid_pair(x, y, divisors):
        return all(d in divisors for d in [x, y])

    def find_pair(divisors):
        for x in range(1, 10000):
            for y in range(1, 10000):
                if is_valid_pair(x, y, divisors):
                    return x, y

    def restore_numbers(divisors):
        x = divisors[0]
        y = divisors[-1]
        while not is_valid_pair(x, y, divisors):
            x += 1
        return x, y

    n = int(stdin.splitlines()[0])
