    assert n <= 128
    assert 2 <= n <= 1000
    assert all(1 <= d <= 10000 for d in divisors)

    merged_divisors = merge_lists(divisors[:n // 2], divisors[n // 2:])
    if is_permutation(divisors, merged_divisors):
        x, y = find_pair(merged_divisors)
    else:
        x, y = restore_numbers(merged_divisors)

    gcd_xy = gcd(x, y)
    x //= gcd_xy
    y //= gcd_xy
    return f"{x} {y}"


