        return "NO\n"

    # Find the spanning tree with the required degree for the first vertex
    spanning_tree = []
    visited = [False] * n
    queue = [(1, 0)]  # Start from vertex 1
    while queue:
        vertex, degree = queue.pop(0)
        if visited[vertex - 1]:
            continue
        visited[vertex - 1] = True
        if degree == D:
            for edge in edges:
                if edge[0] == vertex or edge[1] == vertex:
                    spanning_tree.append(edge)
        else:
            for edge in edges:
                if edge[0] != vertex and edge[1] != vertex and not visited[edge[0] - 1] and not visited[edge[1] - 1]:
                    if edge[0] == vertex:
                        queue.append((edge[1], degree + 1))
                    elif edge[1] == vertex:
                        queue.append((edge[0], degree + 1))
                    else:
                        queue.append((vertex, degree + 1))
                        queue.append((edge[0], degree + 1))
                        queue.append((edge[1], degree + 1))

    # If there is no spanning tree, return NO
    if not spanning_tree:
        return "NO\n"

    # Sort the edges of the spanning tree and return YES followed by the edges
    spanning_tree.sort()
