    total_connections = sum(D)
    if total_connections != N - 1:
        return "NO"

    # Check if the network is a tree
    visited = [False] * (N + 1)
    def dfs(node: int) -> bool:
        if visited[node]:
            return False
        visited[node] = True
        for neighbor in range(1, N + 1):
            if D[node - 1] > 0 and not visited[neighbor]:
                D[node - 1] -= 1
                D[neighbor - 1] -= 1
                if dfs(neighbor):
                    return True
                D[node - 1] += 1
                D[neighbor - 1] += 1
        return True

    return "YES" if dfs(1) else "NO"

